import React, { Component } from 'react'

export class App extends Component {

    render(){
        return(
            <div className="center">
                <nav className="menu">
                    <div className="menu__right">
                        <ul className="menu__list">
                            <li className="menu__list-item"><a className="menu__link menu__link--active" href="#">Home</a></li>
                            <li className="menu__list-item"><a className="menu__link" href="#">Sobre</a></li>
                            <li className="menu__list-item"><a className="menu__link" href="#">Atividade</a></li>
                            <li className="menu__list-item"><a className="menu__link" href="#">Login</a></li>
                        </ul>
                        <button className="menu__search-button"></button>

                    </div>
                </nav>
            </div>
        )
    }

}

export default App;
